events.predicate:
var holder = container.find("#cpf_holder_nd").val();
var dependent = container.find("#cpf_dependent_nd").val()
return "holder = " + holder + " & dependent = " + dependent

var client = container.find("#cpf_deposit").val();
var amount = container.find("#amount_deposit").val()
return "client = " + client + " & amount = " + amount

var client = container.find("#cpf_withdraw").val();
var amount = container.find("#amount_withdraw").val()
return "client = " + client + " & amount = " + amount

var clientSender = container.find("#from_transfer").val();
var clientReceiver = container.find("#to_transfer").val()
var amount = container.find("#amount_transfer").val()
return "clientSender = " + clientSender + " & clientReceiver = " + clientReceiver + " & amount = " + amount

var name = container.find("#name");
var nr = container.find("#nr"); 
return "name = " + name.val() + " & nr = " + nr.val();

data.label:
if(event.canExecute) {
  return '<span>Search for ' + event.predicate + ' in phonebook.</span>';
} else {
  return '<span>' + event.predicate + ' not in phonebook.</span>';
}
